export default {
		send_credentials: async (username, password) => {			
				let res = await getLoginToken.run({ userdata : {'username' : username, 'password' : password} }).catch( () => {
						showAlert("Login ou senha incorretos")
						return {}
				})

				if(res.hasOwnProperty('access')) {
						return res
				}

				return {}
		}	
}
